import React from "react";

class Profile extends React.Component {
    constructor() {
        super();
        this.state = {
            loggedIn: false
        }
    }

    loggedIn() {
        if (this.state.loggedIn !== true) {
            return <div>Sign In/Log In</div>
        } else {
            return <div><Avatar /></div>
        }
    }

    render() {
        return (
            <div className="profile">
                <div>Sign In/Login</div>
            </div>
        )
    }
}

//Sign in/login
//Avatar
//Username
//settings -- dark mode
//Notification
// 

export default Profile;
